import React, { Component } from "react";
import { Cell } from "./Cell";
class GameBoard extends Component {
  render() {
    return (
      <div className="gameBoard">
        <div>
          <Cell />
          <Cell />
          <Cell />
          <Cell />
        </div>
        <div>
          <Cell />

          <Cell />
          <Cell />
          <Cell />
        </div>
      </div>
    );
  }
}

export { GameBoard };
